import {Balloon} from '../gameObjects'
import api from '../api';

// adds a balloon to the DB

export default async function sendBalloon() {

  const balloon = new Balloon()

  await api.addBalloons(balloon).then(res => {
    console.log("Welcome balloon one added")
  })

}
